import React, { useState } from "react";
import { SafeAreaView, View, Text, TouchableOpacity, StyleSheet } from "react-native";

function PreferencesScreen({ navigation }) {
  const [selectedHealthLabels, setSelectedHealthLabels] = useState([]);
  const [selectedDietLabels, setSelectedDietLabels] = useState([]);
  const [selectedCuisines, setSelectedCuisines] = useState([]);
  const [selectedDishTypes, setSelectedDishTypes] = useState([]);
  const [currentStep, setCurrentStep] = useState(1);

  const dietLabels = ["Balanced", "High-Fiber", "High-Protein", "Low-Carb", "Low-Fat", "Low-Sodium"];
  const healthLabels = ["Vegetarian", "Vegan", "Pescatarian", "Peanut-Free", "Dairy-Free", "Alcohol-Free", "Wheat-Free"];
  const cuisineType = ["American", "Asian", "British", "Caribbean", "Chinese", "Italian", "Mexican", "Japanese", "Indian"];
  const dishType = ["Biscuits and Cookies", "Bread", "Cereals", "Desserts", "Drinks", "Main Course"];

  const toggleSelection = (item, category) => {
    switch (category) {
      case "health":
        setSelectedHealthLabels((prev) => {
          if (prev.includes(item)) {
            return prev.filter((label) => label !== item);
          } else {
            return [...prev, item];
          }
        });
        break;
      case "cuisines":
        setSelectedCuisines((prev) => {
          if (prev.includes(item)) {
            return prev.filter((cuisine) => cuisine !== item);
          } else {
            return [...prev, item];
          }
        });
        break;
      case "dishTypes":
        setSelectedDishTypes((prev) => {
          if (prev.includes(item)) {
            return prev.filter((type) => type !== item);
          } else {
            return [...prev, item];
          }
        });
        break;
      default:
        break;
    }
  };

  const nextStep = () => {
    setCurrentStep(currentStep + 1);
  };

  return (
    <SafeAreaView style={styles.container}>
      {currentStep === 1 && (
        <View style={styles.section}>
          <Text style={styles.sectionHeader}>Health Labels</Text>
          {healthLabels.map((label, index) => (
            <TouchableOpacity
              key={index}
              style={[
                styles.option,
                selectedHealthLabels.includes(label) && styles.selectedOption
              ]}
              onPress={() => toggleSelection(label, "health")}
            >
              <Text style={styles.optionText}>{label}</Text>
            </TouchableOpacity>
          ))}
        </View>
      )}

      {currentStep === 2 && (
        <View style={styles.section}>
          <Text style={styles.sectionHeader}>Preferred Cuisines</Text>
          {cuisines.map((cuisine, index) => (
            <TouchableOpacity
              key={index}
              style={[
                styles.option,
                selectedCuisines.includes(cuisine) && styles.selectedOption
              ]}
              onPress={() => toggleSelection(cuisine, "cuisines")}
            >
              <Text style={styles.optionText}>{cuisine}</Text>
            </TouchableOpacity>
          ))}
        </View>
      )}

      {currentStep === 3 && (
        <View style={styles.section}>
          <Text style={styles.sectionHeader}>Preferred Dish Types</Text>
          {dishTypes.map((type, index) => (
            <TouchableOpacity
              key={index}
              style={[
                styles.option,
                selectedDishTypes.includes(type) && styles.selectedOption
              ]}
              onPress={() => toggleSelection(type, "dishTypes")}
            >
              <Text style={styles.optionText}>{type}</Text>
            </TouchableOpacity>
          ))}
        </View>
      )}

      {currentStep < 3 && (
        <TouchableOpacity
          style={styles.nextButton}
          onPress={nextStep}
        >
          <Text style={styles.nextButtonText}>Next</Text>
        </TouchableOpacity>
      )}

      {/* You can display the selected preferences or save the selections here */}
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingHorizontal: 16,
    paddingTop: 16,
  },
  section: {
    marginBottom: 16,
  },
  sectionHeader: {
    fontSize: 20,
    fontWeight: "bold",
  },
  option: {
    flexDirection: "row",
    alignItems: "center",
    padding: 10,
    borderWidth: 1,
    borderColor: "#ccc",
    borderRadius: 7,
    marginVertical: 8,
  },
  selectedOption: {
    backgroundColor: "lightblue",
  },
  optionText: {
    fontSize: 16,
  },
  nextButton: {
    alignItems: "center",
    backgroundColor: "lightblue",
    padding: 12,
    borderRadius: 7,
  },
  nextButtonText: {
    fontSize: 18,
    fontWeight: "bold",
  },
});

export default PreferencesScreen;
